import React, { Component } from 'react';
import Header from '../components/header';
import StarsBackground from '../components/stars';
import Enter from '../components/enter';

class Login extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email: '',
            password: '',
        };
    }

    handleChange = (event) => {
        this.setState({
            [event.target.name]: event.target.value,
        });
    };

    handleSubmit = (event) => {
        event.preventDefault();
        // Здесь вы можете выполнить логику для обработки входа пользователя
        // Например, отправить данные на сервер для проверки и аутентификации
        // Или выполнить другие действия, связанные с входом пользователя

        // После успешного входа, вы можете перенаправить пользователя на другую страницу
        // с помощью объекта history или других методов роутинга в react-router-dom

        // Пример перенаправления на другую страницу:
        // this.props.history.push('/dashboard');
    };

    render() {
        const { email, password } = this.state;

        return (
            <>
                <Header/>
                <StarsBackground/>
                <Enter/>
            </>
        );
    }
}

export default Login;
